import { useEffect } from "react";

function Profile() {
  useEffect(() => {}, []);
  return (
    <div>
      <div>My Profile</div>
      <div>Email:</div>
      <div>Username:</div>
      <div>Address</div>
    </div>
  );
}

export default Profile;
